n=A.b5(A.y(A.a([A.f("\u201cLa Fiesta de Mar\xeda Inmaculada\u201d, cada 08 de diciembre, que esta vez correspondi\xf3 conformarnos con la novena y misa de fiesta, peque\xf1as y controladas serenatas y celebraciones pero que encierran el profundo respeto y amor que el pueblo cat\xf3lico guarda a La Inmaculada Concepci\xf3n de la Sant\xedsima Virgen Mar\xeda, conocida tambi\xe9n como la Pur\xedsima Concepci\xf3n, es un dogma de la Iglesia cat\xf3lica decretado en 1854 que sostiene que la Virgen Mar\xeda estuvo libre del pecado original desde el primer momento de su concepci\xf3n por los m\xe9ritos de su hijo Jesucristo, recogiendo de esta manera el sentir de dos mil a\xf1os de tradici\xf3n cristiana al respecto. Se celebra el 8 de diciembre, nueve meses antes de la celebraci\xf3n de la Natividad de la Virgen el 8 de septiembre. \n\nNo debe confundirse este dogma con la doctrina del nacimiento virginal de Jes\xfas, que sostiene que Jes\xfas fue concebido sin intervenci\xf3n de var\xf3n mientras que Mar\xeda permaneci\xf3 virgen antes, durante y despu\xe9s del parto. \n\nAl desarrollar la doctrina de la Inmaculada Concepci\xf3n, la Iglesia cat\xf3lica contempla la posici\xf3n especial de Mar\xeda por ser madre de Cristo, y sostiene que Dios preserv\xf3 a Mar\xeda desde el momento de su concepci\xf3n de toda mancha o efecto del pecado original, que hab\xeda de transmitirse a todos los hombres por ser descendientes de Ad\xe1n y Eva, en atenci\xf3n a que iba a ser la madre de Jes\xfas, quien tambi\xe9n es Dios. La doctrina reafirma con la expresi\xf3n \xabllena de gracia\xbb (Gratia Plena) contenida en el saludo del arc\xe1ngel Gabriel (Lc. 1,28), y recogida en la oraci\xf3n del Ave Mar\xeda, este aspecto de ser libre de pecado por la gracia de Dios. \n\nGuano es un pueblo con una gran profundidad en el \xe1mbito religioso, es por esto que cada uno de los barrios que conforman la ciudad, honran a su patrono represent\xe1ndolo en las diferentes im\xe1genes de la Virgen, Jes\xfas o alg\xfan Santo. Se puede decir que por parte de los guane\xf1os la Virgen Mar\xeda Inmaculada o \u201cMama Pulli\u201d se venera en el barrio e iglesia del mismo nombre y se le profesa con mucha devoci\xf3n y fe con mayor fidelidad a partir del terremoto de 1949. \n\nLas fiestas en honor a la virgen MAR\xcdA INMACULADA, es catalogado como un atractivo de categor\xeda \u201cmanifestaciones culturales, tipo \u201cacervo cultural popular\u201d, sub tipo \u201cfiestas religiosas, tradiciones y creencias populares\u201d. \n\nLos feligreses de diferentes partes del Ecuador y que la profesan devoci\xf3n, llegan cada a\xf1o a celebrar esta fiesta religiosa el 8 de diciembre. El gran festejo es apegado a las tradiciones de Guano, siendo as\xed reconocido por resaltar el aspecto religioso, incorporando a su celebraci\xf3n una serie de eventos que contribuyen al esparcimiento y diversi\xf3n de propios y extra\xf1os. \n\nEn la agenda de fiestas prima el amor y fe en Mar\xeda Inmaculada con celebraciones eucar\xedsticas, triduos, novenas, caminatas desde el Mirador de la Virgen hasta el barrio y desde Riobamba hasta el barrio La Inmaculada, con presencia multitudinaria de devotos, con c\xe1nticos grandiosos e interminables, serenatas, bandas de pueblo, shows con artistas nacionales e internacionales, juegos populares, corridas de toros, juegos pirot\xe9cnicos, canelazos.  \n\nLa tradicional fiesta taurina est\xe1 tan enraizada en la gente, que de lo popular pas\xf3 incluso al arte profesional, siendo necesario edificar una moderna plaza de toros en su nombre, donde importantes ganader\xedas y diestros del mundo han formado parte de los carteles presentados en las fiestas de diciembre. ",p,p,p,p,p,p,p,A.e(p,p,n,p,p,p,p,p,"Gothic",p,p,16,p,p,p,p,!0,p,p,p,p,p,p,p,p),B.m,p,p)],s),B.c,B.d,B.o))
